            this.time.ss = this.format(this.time.s);
            this.time.S = String(remain);
            this.time.SS = this.format(this.time.S);
            // console.log(remain, this.D, this.h, this.hh, this.H, this.HH, this.m, this.MM, this.s, this.ss, this.S, this.SS);
            return remain > 0;
        },
